INSERT INTO `movies` VALUES (1,'https://www.imdb.com//title/tt0120382/?ref_=chttp_t_137','The Truman Show',8.2,'Top rated movie #137',1998,'1h 43m','470','An insurance salesman discovers his whole life is actually a reality TV show.','1.66 : 1',NULL,NULL,'40 wins & 69 nominations total','Nominated for 3 Oscars'),(2,'https://www.imdb.com//title/tt0055031/?ref_=chttp_t_136','Judgment at Nuremberg',8.3,'Top rated movie #136',1961,'2h 59m','4,337','In 1948, an American court in occupied Germany tries four Nazis judged for war crimes.',NULL,'$3,000,000 (estimated)',NULL,'16 wins & 26 nominations total','Won 2 Oscars'),(3,'https://www.imdb.com//title/tt0469494/?ref_=chttp_t_138','There Will Be Blood',8.2,'Top rated movie #138',2007,'2h 38m','325','A story of family, religion, hatred, oil and madness, focusing on a turn-of-the-century prospector in the early days of the business.','$76,182,388','$25,000,000 (estimated)','English','114 wins & 138 nominations total','Won 2 Oscars'),(4,'https://www.imdb.com//title/tt0042192/?ref_=chttp_t_135','All About Eve',8.2,'Top rated movie #135',1950,'2h 18m','4,255','A seemingly timid but secretly ruthless ingénue insinuates herself into the lives of an aging Broadway star and her circle of theater friends.','$151,052','$1,400,000 (estimated)','English','27 wins & 20 nominations total','Won 6 Oscars'),(5,'https://www.imdb.com//title/tt0111161/?ref_=chttp_t_1','The Shawshank Redemption',9.3,'Top rated movie #1',1994,'2h 22m','76','Over the course of several years, two convicts form a friendship, seeking consolation and, eventually, redemption through basic compassion.',NULL,NULL,NULL,'21 wins & 42 nominations total','Nominated for 7 Oscars'),(6,'https://www.imdb.com//title/tt10272386/?ref_=chttp_t_133','The Father',8.2,'Top rated movie #133',2020,'1h 37m','1,138','A man refuses all assistance from his daughter as he ages. As he tries to make sense of his changing circumstances, he begins to doubt his loved ones, his own mind and even th